import React from "react";

const CurrentWeather =({CurrentWeather})=>{
   let location;
   let temp;
   let description;
   let currentWeather;
   let weatherImage;
    if(!CurrentWeather){
        location= temp= description= currentWeather= weatherImage="loading...";
    }
   return (
    <div className="weatherContainer currentWeather">
<h2>{currentWeather}</h2>
<h3 className="currentLocation"> {location}</h3>
<p>{temp}</p>
<img src={weatherImage} alt={weatherImage}/>
<p>{description}</p>
    </div>

   )


}
export default CurrentWeather
